import React from "react";
import "./../styles.scss";

class ProfileForm extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="content">
        <div className="box">
          <div className="row">
            <img
              src={require("./../../../../images/cute-panda-bear-cartoon-flat-icon-avatar-round-circle-KM805A.jpg.png")}
              className="picture-avatar"
              alt="avatar"
            />
          </div>
        </div>
      </div>
    );
  }
}

export default ProfileForm;
